script: |
  super -f text -I q6377.spq | sort > q6377.out

inputs:
  - name: q6377.spq
    data: |
      SELECT DISTINCT + + 90 + - col0 / - 99 + + col1 / - - col2 col1, - col0 / col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q6377.out
    data: |
      90	-1
      91	-1
      92	-1
